nual\")\n","p6 <- p6 + labs(x= \"User Type by Day of the Week\" ,y= \"Number of Rides by Day of the Week\")\n","\n","p6"]},{"cell_type":"markdown","id":"4bb06c72","metadata":{"papermill":{"duration":0.024845,"end_time":"2024-09-12T18:27:21.826736","exception":false,"start_time":"2024-09-12T18:27:21.801891","status":"completed"},"tags":[]},"source":["> #### The total number of all rides does not have significant differences during the whole week. \n","> #### The total number of rides are lower on the weekends for the annual members while it is the opposite for the casual riders."]},{"cell_type":"markdown","id":"92c25068","metadata":{"papermill":{"duration":0.025596,"end_time":"2024-09-12T18:27:21.877132","exception":false,"start_time":"2024-09-12T18:27:21.851536","status":"completed"},"tags":[]},"source":["## 3.5 - Share Phase \n","### (Sharing the findings, insights, and recommendations with the stakeholders, in this case, the director of marketing)\n","Prepared a presentation with data visualizations and recommendations, with the below conclusion:\n","\n","#### Recommendation 1:\n","> Finding:\n","Although Casual Riders account for only 9% of the total rides; however, they account for 39% of the trip durations and the average trip duration by the casual riders is almost 6 times higher than that of the annual members.\n","\n","> Insight:\n","Since the fares are paid by duration and not by ride, the value of business that casual riders are bringing is higher than the annual members, even though the number of rides by casual riders are way less than the annual members.\n","\n","> Recommendation:\n","Prepare a marketing campaign to target new clients.\n","\n","#### Recommendation 2:\n","> Finding:\n","The number of rides by annual members during the week are less than the weekends.\n","The average trip duration by annual members during the week is less than the weekends.\n","\n","> Insight:\n","The difference in use of the bikes throughout the week shows that Annual members use Cyclist bikes to commute to work or school.\n","\n","> Recommendation:\n","Prepare a marketing campaign to target students and employees\n","\n","#### Recommendation 3:\n","> Finding:\n","The number of rides by casual riders are almost the same during the week, except on Thursday.\n","The average trip duration by casual riders during the week is less than the weekends, except on Thursday.\n","\n","> Insight:\n","Thursdays have the most rides and trip durations for casual riders. None of those Thursdays were a public holiday.\n","Casual riders’ behavior are unpredictable.\n","\n","> Recommendation:\n","Need to study more data to better understand casual riders’ behaviors\n","\n","#### Based on the findings above, it is important to prepare an advertising campaign to target casual riders into becoming annual members, but it is as important to prepare a marketing campaign to target non-riders.  "]},{"cell_type":"markdown","id":"2604f011","metadata":{"papermill":{"duration":0.02464,"end_time":"2024-09-12T18:27:21.926584","exception":false,"start_time":"2024-09-12T18:27:21.901944","status":"completed"},"tags":[]},"source":["## 3.6 -  Act Phase \n","### (Acting on the recommendations)\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":5638904,"sourceId":9310920,"sourceType":"datasetVersion"},{"datasetId":5682666,"sourceId":9369972,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":2304.953163,"end_time":"2024-09-12T18:27:22.877832","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-09-12T17:48:57.924669","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}